import React, {useState, useEffect} from 'react';
import Togglebutton from './Togglebutton';
import './Diagnose.css'


function Diagnose(){

    const letter = "";
    const [data, setData] = useState([{}]);



    useEffect(() => {
        fetch('/sys').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                // console.log(data)
            }
        )  
    }, [])


    return (
        <div className='Diagnose-page'>
            <h1>Select Symptoms: </h1>


        </div>
    );
}

export default Diagnose;
